* {
    box-sizing: border-box;
}

:root {
    --sait: var(--android-safe-area-inset-top, env(safe-area-inset-top));
    --saib: var(--android-safe-area-inset-bottom, env(safe-area-inset-bottom));
    --sail: var(--android-safe-area-inset-left, env(safe-area-inset-left));
    --sair: var(--android-safe-area-inset-right, env(safe-area-inset-right));
    --blue-gradient: linear-gradient(180deg, #70a1ff 0%, #5d8eec 100%);
    --orange-gradient: linear-gradient(180deg, #fbbd5e 0%, #ffa316 100%);
}

a {
    text-decoration: none;
}

body {
    font-family: Font_LABEL, sans-serif;
    color: #000;
    text-align: inherit;
    -webkit-touch-callout: none;
    -webkit-user-select: none;
}

.avatar {
    width: 50px;
    height: 50px;
    border-radius: 25px;
}

.avatar-large {
    width: 100px;
    height: 100px;
    border-radius: 50px;
}

.avatar-small {
    width: 30px;
    height: 30px;
    border-radius: 15px;
}

.fcc {
    display: flex;
    align-items: center;
    justify-content: center;
}

.tab {
    text-align: center;
    font-size: 12px;
    color: #666;
}

.tab.active {
    color: #ffc13f;
}

.btn {
    background: var(--blue-gradient);
    text-shadow: 0 1px rgba(0, 0, 0, 0.2);
    color: #fff;
    border-radius: 5px;
    cursor: pointer;
    font-size: 20px;
    height: 40px;
    line-height: 40px;
    text-align: center;
    display: flex;
    align-items: center;
    justify-content: center;
}

.btn.alt {
    background: var(--orange-gradient);
}

.btn.outline {
    background: #fff;
    border: 1px solid #70a1ff;
    text-shadow: none;
    color: #70a1ff;
}

.btn.outline.grey {
    border: 1px solid #ddd;
    text-shadow: none;
    color: #aaa;
}

.btn.outline.red {
    border: 1px solid #e74c3c;
    text-shadow: none;
    color: #e74c3c;
}

.btn.grey {
    background: #fff;
    border: none;
    text-shadow: none;
    color: #aaa;
}

.btn.disabled {
    background: #ccc;
}

.btn:active,
.close:active {
    background-position: right center;
    transform: scale(0.95);
}

.modal .btns {
    display: flex;
    flex-direction: row;
    align-items: center;
    flex: 0 0 60px;
    margin: 0 15px;
}

.modal .btns .btn {
    flex: 1;
    margin: 0 10px 0 0;
}

.modal .btns .btn:last-child {
    margin: 0;
}

.close {
    cursor: pointer;
}

.sep20 {
    padding: 20px 0 0 0;
}

.sep10 {
    padding: 10px 0 0 0;
}

.sep5 {
    padding: 5px 0 0 0;
}

.sep15 {
    padding: 15px 0 0 0;
}

.mt5 {
    margin-top: 5px;
}

.p10 {
    padding: 10px;
}

.p20 {
    padding: 20px;
}

.nobreak {
    white-space: nowrap;
}

video.friend-match {
    width: 100%;
    border: 1px solid #eee;
    border-radius: 10px;
}

.modal {
    position: fixed;
    top: 0;
    left: 0;
    bottom: 0;
    right: 0;
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
    color: #333;
    background: rgba(0, 0, 0, 0.6);
    padding: 0 var(--extra-left-right);
}

.modal a {
    text-decoration: none;
}

.modal .close {
    position: absolute;
    right: calc(var(--extra-left-right) + 25px);
    top: 25px;
    font-size: 30px;
    color: #aaa;
    z-index: 1;
}

.modal .close:before {
    font-family: MaterialIcons_LABEL;
    font-weight: normal;
    font-style: normal;
    line-height: 1;
    text-transform: none;
    letter-spacing: normal;
    word-wrap: normal;
    white-space: nowrap;
    direction: ltr;
    -webkit-font-smoothing: antialiased;
    text-rendering: optimizeLegibility;
    -moz-osx-font-smoothing: grayscale;
    font-feature-settings: "liga";
    content: "close";
}

.modal .banner {
    align-self: stretch;
    padding: 10px;
    background: #fff3cd;
    border-bottom: 1px solid #ffeeba;
    color: #856404;
}

.modal a:active {
    transform: scale(0.95);
}

.modal.opaque {
    background: #fff;
}

.modal h2 {
    font-size: 24px;
    font-weight: normal;
    margin: 0 0 10px 0;
}

.modal .header {
    padding-top: var(--sait);
    background: var(--blue-gradient);
    color: #fff;
    font-size: 20px;
    width: 100%;
    display: flex;
    align-items: center;
    justify-content: center;
    flex-direction: column;
    position: relative;
}

.modal .header .close {
    position: absolute;
    right: 10px;
    top: calc(var(--sait) + 30px);
    color: #fff;
}

.modal .header .title {
    height: 50px;
    line-height: 50px;
}

.modal .header .resources {
    height: 20px;
    font-size: 12px;
    align-self: stretch;
    padding: 0 15px;
    display: flex;
    flex-direction: row;
    align-items: center;
}

.modal .header .resources div {
    width: 33.33%;
    text-align: center;
}

.modal .header .resources div:first-child {
    text-align: left;
}

.modal .header .resources div:last-child {
    text-align: right;
}

.modal p {
    margin: 0 0 5px 0;
}

.loading {
    position: fixed;
    top: 0;
    left: 0;
    bottom: 0;
    right: 0;
    display: flex;
    align-items: center;
    justify-content: center;
    background: #fff;
    z-index: 3;
}

.loading .tips {
    position: absolute;
    bottom: calc(var(--saib) + 20px);
    width: 90%;
    text-align: center;
    color: #aaa;
    font-size: 14px;
}

.loader,
.loader:after {
    border-radius: 50%;
    width: 50px;
    height: 50px;
}

.loader {
    margin: 0 auto;
    font-size: 10px;
    position: relative;
    text-indent: -9999em;
    border-top: 5px solid rgba(0, 0, 0, 0.2);
    border-right: 5px solid rgba(0, 0, 0, 0.2);
    border-bottom: 5px solid rgba(0, 0, 0, 0.2);
    border-left: 5px solid #ffffff;
    transform: translateZ(0);
    animation: loader 1.1s infinite linear;
}

.loader.dark {
    border-top-color: rgba(0, 0, 0, 0.2);
    border-right-color: rgba(0, 0, 0, 0.2);
    border-bottom-color: rgba(0, 0, 0, 0.2);
}

@keyframes loader {
    0% {
        transform: rotate(0deg);
    }

    100% {
        transform: rotate(360deg);
    }
}

.modal .row {
    display: flex;
    flex-direction: row;
    align-items: center;
}

.modal .scrollable {
    width: 100%;
    flex: 1;
    overflow-y: auto;
    -webkit-overflow-scrolling: touch;
    padding-bottom: var(--saib);
}

.modal .container .scrollable {
    padding: 15px 15px 5px 15px;
}

.modal .container {
    width: 80%;
    max-height: 80%;
    background: #fff;
    border-radius: 10px;
    display: flex;
    flex-direction: column;
    justify-content: center;
}

.tabs {
    width: 100%;
    display: flex;
    flex-direction: row;
    align-items: center;
    padding: 10px 10px 0 10px;
}

.tabs a {
    flex: 1;
    color: #333;
    text-align: center;
    background: #eee;
    margin: 5px;
    padding: 10px;
    border-radius: 5px;
}

.tabs a.active {
    color: #fff;
    background: #ffc13f;
}

.text-right {
    text-align: right;
}

.text-s {
    font-size: 12px;
}

.text-m {
    font-size: 14px;
}

.text-xl {
    font-size: 24px;
}

.text-l {
    font-size: 20px;
}

.text-center {
    text-align: center;
}

.text-desc {
    color: #999;
}

.border-top {
    border-top: 0.5px solid #ddd;
}

.row .box {
    flex: 1;
}

.two-col,
.two-col-r {
    display: flex;
    flex-direction: row;
    align-items: center;
}

.two-col > :last-child {
    flex: 1;
    text-align: right;
    justify-content: flex-end;
}

.two-col > :last-child input {
    border: 0 none;
    padding: 0;
    width: 100%;
    text-align: right;
}

.two-col-r > :first-child {
    flex: 1;
}

.col {
    display: flex;
    flex-direction: row;
    align-items: center;
}

.col.subheader {
    width: 100%;
    background: #f8f8f8;
    border-bottom: 1px solid #eee;
    padding: 10px 15px;
}

.col .f1 {
    flex: 1;
}

input,
input:focus {
    border: 0 none;
    outline: none;
}

input::placeholder {
    color: #999;
}

.flex-right {
    display: flex;
    justify-items: flex-end;
}

.vs {
    display: flex;
    flex-direction: row;
    justify-content: center;
    align-items: center;
}

.vs > div:first-child,
.vs > div:last-child {
    flex: 1;
    text-align: center;
}

.box {
    border: 1px solid #eee;
    border-radius: 5px;
    padding: 10px;
    margin: 15px;
    overflow: hidden;
}

.box .action {
    border-top: 1px solid #eee;
    color: #70a1ff;
    text-transform: uppercase;
    text-align: center;
    margin: 10px -10px -10px;
    display: flex;
    flex-direction: row;
}

.box .action.filled {
    color: #fff;
    background: var(--blue-gradient);
}

.box .action.disabled {
    color: #ccc;
}

.box .hr {
    border-top: 1px solid #eee;
    margin: 10px -10px;
}

.action div {
    cursor: pointer;
    padding: 10px;
    flex: 1;
    border-left: 1px solid #eee;
    display: flex;
    align-items: center;
    justify-content: center;
}

.action div:first-child {
    border-left: 0 none;
}

.match-player {
    height: 200px;
    display: flex;
    justify-content: center;
    align-items: center;
    flex-direction: column;
    font-size: 18px;
}

.row .spacer {
    width: 10px;
}

.row .right {
    flex: 1;
    text-align: right;
}

table.leaderboard {
    border-collapse: collapse;
    width: 100%;
}

table.leaderboard tr {
    height: 40px;
}

table.leaderboard img {
    vertical-align: middle;
}

table.leaderboard tr td:first-child {
    padding-left: 15px;
}

table.leaderboard tr td:last-child {
    padding-right: 15px;
}

table.leaderboard tr.me {
    color: #fff;
    background: #ffc13f;
}

.w25 {
    width: 25px;
}

.w50 {
    width: 50px;
}

.toast {
    font-size: 14px;
    background: rgba(0, 0, 0, 0.8);
    color: #fff;
    position: absolute;
    bottom: var(--saib);
    left: 0;
    width: calc(95% - var(--extra-left-right) * 2);
    margin: 2.5% calc(var(--extra-left-right) + 2.5%);
    padding: 10px;
    border-radius: 5px;
    animation: fadein 0.5s;
}

@keyframes fadein {
    from {
        opacity: 0;
    }

    to {
        opacity: 1;
    }
}

.progress {
    height: 10px;
    border-radius: 5px;
    overflow: hidden;
    width: 100%;
    background: #eee;
}

.progress .fill {
    height: 10px;
    border-radius: 5px;
    background: var(--blue-gradient);
}

.green,
a.green {
    color: #2ecc71;
}

.red,
a.red {
    color: #e74c3c;
}

.orange,
a.orange {
    color: #ffc13f;
}

.purple,
a.purple {
    color: #9b59b6;
}

.blue,
a.blue {
    color: #70a1ff;
}

.grey {
    color: #ccc;
}

.dark-grey {
    color: #999;
}

.m15 {
    margin: 15px;
}

.mh15 {
    margin-left: 15px;
    margin-right: 15px;
}

.mr10 {
    margin-right: 10px;
}

.mr20 {
    margin-right: 20px;
}

.ml10 {
    margin-left: 10px;
}

.ml20 {
    margin-left: 20px;
}

.mt20 {
    margin-top: 20px;
}

.mb5 {
    margin-bottom: 5px;
}

.pointer {
    cursor: pointer;
}

.mi {
    font-family: MaterialIcons_LABEL;
    font-weight: normal;
    font-style: normal;
    font-size: 24px; /* Preferred icon size */
    display: inline-block;
    line-height: 1;
    text-transform: none;
    letter-spacing: normal;
    word-wrap: normal;
    white-space: nowrap;
    direction: ltr;

    /* Support for all WebKit browsers. */
    -webkit-font-smoothing: antialiased;
    /* Support for Safari and Chrome. */
    text-rendering: optimizeLegibility;

    /* Support for Firefox. */
    -moz-osx-font-smoothing: grayscale;

    /* Support for IE. */
    font-feature-settings: "liga";
}

.slots {
    display: flex;
    flex-direction: row;
    align-items: center;
    justify-content: space-evenly;
}

.slots > div {
    width: 40px;
    height: 40px;
    text-transform: uppercase;
    display: flex;
    align-items: center;
    justify-content: center;
    border-radius: 8px;
    font-size: 18px;
}

.slot-none {
    color: #666;
    background: #ddd;
}

.slot-dl {
    color: #fff;
    background: #ff78ba;
}

.slot-tl {
    color: #fff;
    background: #9acf0b;
}

.slot-dw {
    color: #fff;
    background: #00c1ff;
}

.slot-tw {
    color: #fff;
    background: #ee223b;
}

.booster {
    display: flex;
    flex-wrap: wrap;
    justify-content: space-evenly;
}

.booster-item {
    width: 100px;
    border: 2px solid #ddd;
    border-radius: 5px;
    overflow: hidden;
    margin: 10px;
    display: flex;
    flex-direction: column;
    align-items: center;
}

.booster-common {
    color: #7f8c8d;
    border-color: #7f8c8d;
}
.booster-rare {
    color: #f39c12;
    border-color: #f39c12;
}
.booster-epic {
    color: #a29bfe;
    border-color: #a29bfe;
}

.booster-item img {
    width: 100%;
}

.booster-item .action {
    width: 100%;
    white-space: nowrap;
    overflow: hidden;
    text-overflow: ellipsis;
    text-align: center;
    color: #fff;
    background: var(--blue-gradient);
    cursor: pointer;
    padding: 5px 10px;
    font-size: 14px;
}

.booster-item .action.locked {
    background: linear-gradient(180deg, #aaa 0%, #999 100%);
}

.shop-item .action.primary {
    animation: highlight 0.5s repeat alternate;
    background: linear-gradient(180deg, #ffc13f 0%, #e7ac2d 100%);
}

.shop-item .action.secondary {
    background: linear-gradient(180deg, rgb(150, 150, 150) 0%, rgb(130, 130, 130) 100%);
}

.shop-item .action.muted {
    color: #999;
    background: #fff;
}

.share-box {
    cursor: pointer;
    font-size: 16px;
    color: #70a1ff;
    border: 1px solid #ddd;
    display: flex;
    flex-direction: row;
    border-radius: 5px;
    overflow: hidden;
}

.share-box:hover {
    border: 1px solid #70a1ff;
}

.share-box img {
    width: 100px;
    height: 100px;
}

.share-box :last-child {
    flex: 1;
    display: flex;
    align-items: center;
    justify-content: center;
    padding: 0 20px;
}

.discord {
    background: #7289da;
    color: #fff;
    font-size: 12px;
    margin: 15px;
    padding: 10px;
    border-radius: 5px;
}

.discord img {
    width: 25%;
}

